import { useState } from 'react';

function App() {
  let [count, setCount] = useState(0)

  function plus(){
    setCount(count + 1)
    if(count <= 33){
      count = 0
    }
  }


  return (
    <div className="App">
        <h1>Al zikir</h1>

        <h3>{count}</h3>

        <button onClick={plus}>+</button>

    </div>
  );
}

export default App;
